      .small-window {
        position: fixed;
        top: 0%;
        right: 0%;
        width: 100%;
        height: 100%;
        background-color: white;
        box-shadow: 0px 0px 10px gray;
        display: none;
        border:none;
      }
  
      .minus-button {
        position: absolute;
        top: -4px;
        right: 70px;
        font-size:30px;
        cursor: pointer;
      }
  
      .close-button {
        position: absolute;
        top: -6px;
        right: 10px;
        font-size: 24px;
        cursor: pointer;
      }
    </style>
  </head>
  <body>
    <div class="small-window">
      <div class="header">
        <span>Please Wait For It To Load Patiently</span>
        <span class="minus-button">&#8722;</span>
        <span class="close-button">&#x2715;</span>
      </div>
      <iframe src="" width="100%" height="100%"></iframe>
    </div>
  
    <script>
      var openLinks = document.querySelectorAll('.open-window');
  
      openLinks.forEach(function(link) {
        link.addEventListener('click', function(event) {
          event.preventDefault();
          var page = link.getAttribute('data-src');
          var iframe = document.querySelector('.small-window iframe');
          var windowElement = document.querySelector('.small-window');
          iframe.src = page;
          windowElement.style.display = 'block';
          windowElement.dataset.src = page;
        });
      });
  
      document.querySelector('.minus-button').addEventListener('click', function() {
        var iframeSrc = document.querySelector('.small-window iframe').src;
        var windowElement = document.querySelector('.small-window');
        windowElement.style.display = 'none';
        windowElement.dataset.src = iframeSrc;
      });
  
      document.querySelector('.close-button').addEventListener('click', function() {
        document.querySelector('.small-window').style.display = 'none';
        var iframe = document.querySelector('.small-window iframe');
        iframe.src = '';
        var windowElement = document.querySelector('.small-window');
        windowElement.dataset.src = '';
      });
      document.querySelector('.minus-button').addEventListener('click', function() {
    var iframeSrc = document.querySelector('.small-window iframe').src;
    var windowElement = document.querySelector('.small-window');
    windowElement.style.display = 'none';
    windowElement.dataset.src = iframeSrc;
  });
  
  var iframeContainer = document.querySelector('.small-window');

var fullscreenButton = document.createElement('div');
fullscreenButton.innerHTML = '&#9744;';
fullscreenButton.className = 'fullscreen-button';

fullscreenButton.style.position = 'absolute';
fullscreenButton.style.top = '-6px';
fullscreenButton.style.right = '39px';
fullscreenButton.style.fontSize = '24px';
fullscreenButton.style.cursor = 'pointer';

iframeContainer.appendChild(fullscreenButton);

fullscreenButton.addEventListener('click', function() {
var iframeElement = iframeContainer.querySelector('iframe');
if (iframeElement.requestFullscreen) {
  iframeElement.requestFullscreen();
} else if (iframeElement.mozRequestFullScreen) {
  iframeElement.mozRequestFullScreen();
} else if (iframeElement.webkitRequestFullscreen) {
  iframeElement.webkitRequestFullscreen();
} else if (iframeElement.msRequestFullscreen) {
  iframeElement.msRequestFullscreen();
}
});

    </script>

      const button = document.getElementById('menu-button');
      const navbar = document.getElementById('navbar');
  
      button.addEventListener('click', () => {
        navbar.classList.toggle('active');
      });
